import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
import Card from './Card'
import Sdata from './Sdata'

ReactDOM.render(
    <>
        <div className='head'>
            <h1>BEST NETFLIX SERIES</h1>
        </div>
        <div id='card'>
            {Sdata.map((val) => {
                return (
                    <Card
                    key={val.id} 
                    imgsrc={val.imagesrc} 
                    stitle={val.stitle} 
                    ctit={val.ctitle} />
                );
            })}
        </div>
    </>
    , document.getElementById('root')
)
